create or replace function random_choice(text[]) returns text as $$
  select $1[ceil(random() * array_length($1, 1))];
  $$ language sql;

create or replace function random_choice(integer[]) returns integer as $$
  select $1[ceil(random() * array_length($1, 1))];
  $$ language sql;

create or replace function random_uniform(integer, integer) returns integer as $$
	/* Return a random integer between a and b, inclusive */
	select trunc(random() * ($2 - $1 + 1) + $1)::integer;
	$$ language sql;

create or replace function random_uniform(real, real) returns real as $$
	/* Return a random integer between a and b, inclusive */
	select (random() * ($2 - $1) + $1)::real;
	$$ language sql;

create or replace function random_uniform(double precision, double precision) returns double precision as $$
	/* Return a random integer between a and b, inclusive */
	select (random() * ($2 - $1) + $1)::double precision;
	$$ language sql;

create or replace function random_uniform(timestamp, timestamp) returns timestamp as $$
	/* Return a random integer between a and b, inclusive */
	select make_interval(secs := random() * extract(epoch from $2 - $1)) + $1
	$$ language sql;

