create or replace function fake_domain(name text) returns text as $$
declare
  tlds text[] = '{"com", "io", "ly", "org", "net", "de", "cn", "ru", "it", "us", "co", "biz", "in"}';
begin
  return lower(regexp_replace(name, '[^\w]', '-')) || '.' || random_choice(tlds);
end;
$$ language plpgsql;

create or replace function generate_email(name text, domain text) returns text as $$
  begin
    return lower(regexp_replace(name, '[^\w]', '.')) || '@' || domain;
  end;
  $$ language plpgsql;

create or replace function generate_email(name text) returns text as $$
  begin
    return generate_email(name, fake_domain());
  end;
  $$ language plpgsql;


create or replace function generate_email() returns text as $$
  begin
    return generate_email(random_name(), fake_domain());
  end;
  $$ language plpgsql;
